public List<Combat> addAttackers(Game game) {
    Map<Integer, Combat> engagements = new HashMap<>();
    //useful only for two player games - will only attack first opponent
    UUID defenderId = game.getOpponents(playerId).iterator().next();
    List<Permanent> attackersList = super.getAvailableAttackers(defenderId, game);
    //use binary digits to calculate powerset of attackers
    int powerElements = (int) Math.pow(2, attackersList.size());
    StringBuilder binary = new StringBuilder();
    for (int i = powerElements - 1; i >= 0; i--) {
        Game sim = game.copy();
        binary.setLength(0);
        binary.append(Integer.toBinaryString(i));
        while (binary.length() < attackersList.size()) {
            binary.insert(0, '0');
        }
        for (int j = 0; j < attackersList.size(); j++) {
            if (binary.charAt(j) == '1') {
                setStoredBookmark(sim.bookmarkState()); // makes it possible to UNDO a declared attacker with costs from e.g. Propaganda
                if (!sim.getCombat().declareAttacker(attackersList.get(j).getId(), defenderId, playerId, sim)) {
                    sim.undo(playerId);
                }
            }
        }
        if (engagements.put(sim.getCombat().getValue().hashCode(), sim.getCombat()) != null) {
            logger.debug("simulating -- found redundant attack combination");
        } else {

        return n1.compareTo(n2);
    });
}

// search
if (choice.isSearchEnabled()) {
    panelSearch.setVisible(true);
    this.editSearch.setText(choice.getSearchText());
} else {
    panelSearch.setVisible(false);
    this.editSearch.setText("");
}

// listeners for inremental filtering        
editSearch.getDocument().addDocumentListener(new DocumentListener() {
    @Override
    public void insertUpdate(DocumentEvent e) {
        choice.setSearchText(editSearch.getText());
        loadData();
    }

    @Override
    public void removeUpdate(DocumentEvent e) {
        choice.setSearchText(editSearch.getText());
        loadData();
    }

    @Override
    public void changedUpdate(DocumentEvent e) {
        choice.setSearchText(editSearch.getText());
        loadData();
    }
});

// listeners for select up and down without edit focus lost
editSearch.addKeyListener(new KeyListener() {
    @Override
    public void keyTyped(KeyEvent e) {
        //System.out.println("types");                
    }

    @Override
    public void keyPressed(KeyEvent e) {
        if (e.getKeyCode() == KeyEvent.VK_UP) {
            doPrevSelect();
        } else if (e.getKeyCode() == KeyEvent.VK_DOWN) {
            doNextSelect();
        }
    }

    @Override
    public void keyReleased(KeyEvent e) {
        //System.out.println("released");
    }
});

// listeners double click choose
listChoices.addMouseListener(new MouseAdapter() {
    @Override
    public void mouseClicked(MouseEvent e) {
        if (e.getClickCount() == 2) {
            doChoose();
        }
    }

