@Override
public boolean replaceEvent(GameEvent event, Ability source, Game game) {
    Player controller = game.getPlayer(source.getControllerId());
    if (controller != null) {
        Card card = game.getCard(event.getTargetId());
        if (card != null) {
            discard();
            return controller.moveCards(
                    card, Zone.EXILED, source, game, false, false, false, event.getAppliedEffects());
        }
    }
    return false;
}

@Override
public boolean checksEventType(GameEvent event, Game game) {
    return event.getType() == GameEvent.EventType.ZONE_CHANGE;
}

@Override
public boolean applies(GameEvent event, Ability source, Game game) {

}

// Determine column
int cardWidth = getCardWidth();
int cardHeight = getCardHeight();
int cardTopHeight = CardRenderer.getCardTopHeight(cardWidth);
int dx = x % (cardWidth + GRID_PADDING);
int col = x / (cardWidth + GRID_PADDING);
int gridWidth = cardGrid.isEmpty() ? 0 : cardGrid.get(0).size();

if (dx < GRID_PADDING && col < gridWidth) {
    // Which row to add to?
    int curY = COUNT_LABEL_HEIGHT;
    int rowIndex = 0;
    for (int i = 0; i < cardGrid.size(); ++i) {
        int maxStack = maxStackSize.get(i);
        int rowHeight = cardTopHeight * (maxStack - 1) + cardHeight;
        int rowBottom = curY + rowHeight + COUNT_LABEL_HEIGHT;

        // Break out if we're in that row
        if (y < rowBottom) {
            // Set the row
            rowIndex = i;
            break;
        } else {
            rowIndex = i + 1;
            curY = rowBottom;
        }
    }

    this.baseCondition = effect.baseCondition;
    this.initDone = effect.initDone;
}

@Override
public boolean isDiscarded() {
    return this.discarded || effect.isDiscarded() || (otherwiseEffect != null && otherwiseEffect.isDiscarded());
}

@Override
public void init(Ability source, Game game) {
    super.init(source, game);
    if (baseCondition instanceof LockedInCondition) {
        condition = new FixedCondition(((LockedInCondition) baseCondition).getBaseCondition().apply(game, source));
    } else {
        condition = baseCondition;
    }
    effect.setTargetPointer(this.targetPointer);
    effect.init(source, game);
    if (otherwiseEffect != null) {
        otherwiseEffect.setTargetPointer(this.targetPointer);
        otherwiseEffect.init(source, game);
    }
    initDone = true;
}

@Override
public boolean apply(Layer layer, SubLayer sublayer, Ability source, Game game) {

    targets = game.getBattlefield().getActivePermanents(((FilterCreatureOrPlayer) origTarget.getFilter()).getCreatureFilter(), playerId, game);
}
for (Permanent permanent : targets) {
    List<UUID> alreadyTargeted = target.getTargets();
    if (target.canTarget(abilityControllerId, permanent.getId(), source, game)) {
        if (alreadyTargeted != null && !alreadyTargeted.contains(permanent.getId())) {
            return tryAddTarget(target, permanent.getId(), source, game);
        }
    }
}

if (outcome.isGood()) {
    if (target.canTarget(abilityControllerId, abilityControllerId, source, game)) {
        return tryAddTarget(target, abilityControllerId, source, game);
    }
} else if (target.canTarget(abilityControllerId, randomOpponentId, source, game)) {
    return tryAddTarget(target, randomOpponentId, source, game);
}

for (Card card : deck.getCards()) {
    if (!isSetAllowed(card.getExpansionSetCode())) {
        if (!legalSets(card)) {
            addError(DeckValidatorErrorType.WRONG_SET, card.getName(), "Not allowed Set: " + card.getExpansionSetCode(), true);
            valid = false;
        }
    }
}
for (Card card : deck.getSideboard()) {
    if (!isSetAllowed(card.getExpansionSetCode())) {
        if (!legalSets(card)) {
            addError(DeckValidatorErrorType.WRONG_SET, card.getName(), "Not allowed Set: " + card.getExpansionSetCode(), true);
            valid = false;
        }
    }
}
// Check for companion legality
if (companion != null) {
    Set<Card> cards = new HashSet<>(deck.getCards());
    cards.addAll(commanders);

    if (affectedObjectsSet) {
        // Added boosts of activated or triggered abilities exist independent from the source they are created by
        // so a continuous effect for the permanent itself with the attachment is created
        Permanent equipment = game.getPermanentOrLKIBattlefield(source.getSourceId());
        if (equipment != null && equipment.getAttachedTo() != null) {
            this.setTargetPointer(new FixedTarget(equipment.getAttachedTo(), game.getState().getZoneChangeCounter(equipment.getAttachedTo())));
        }
    }
}

@Override
public boolean apply(Game game, Ability source) {
    Permanent permanent = null;
    if (affectedObjectsSet) {
        permanent = game.getPermanent(targetPointer.getFirst(game, source));
        if (permanent == null) {
            discard();
            return true;
        }
    } else {
        Permanent equipment = game.getPermanent(source.getSourceId());
        if (equipment != null && equipment.getAttachedTo() != null) {
            permanent = game.getPermanent(equipment.getAttachedTo());

            if (revealCards) {
                String name = "Reveal";
                Card sourceCard = game.getCard(source.getSourceId());
                if (sourceCard != null) {
                    name = sourceCard.getIdName();
                }
                controller.revealCards(name, cards, game);
            }
        }
        controller.shuffleLibrary(source, game);
        return true;
    }
    if (forceShuffle) {
        controller.shuffleLibrary(source, game);
    }
    return false;
}

private void setText() {
    StringBuilder sb = new StringBuilder();
    sb.append(rulePrefix);
    if (target.getNumberOfTargets() == 0 && target.getMaxNumberOfTargets() > 0) {
        sb.append("up to ").append(CardUtil.numberToText(target.getMaxNumberOfTargets())).append(' ');
        sb.append(target.getTargetName());

        this.expansionSetCodeForImage = expansionSetCodeForImage;
    }

