@Override
public void start() {
    cardNum = 1;
    boosterNum = 1;
    while (!isAbort() && cardNum <= 36) {
        openBooster();
        cardNum = 1;
        fireUpdatePlayersEvent();
        while (!isAbort() && pickCards()) {
            // new booster each time, so order is irrelevant
            passBoosterToLeft();
            fireUpdatePlayersEvent();
        }
        boosterNum++;
    }
    this.fireEndDraftEvent();
}

