public void showExileDialog(CardsView cards, BigCard bigCard, UUID gameId) {

    int w = 720;
    int h = 550;

    int height = getHeight();
    int width = getWidth();

    int x = ((width - w) / 2);
    int y = ((height - h) / 2);

    DlgParams params = new DlgParams();
    params.rect = new Rectangle(x, y, w, h);
    params.bigCard = bigCard;
    params.gameId = gameId;
    params.setCards(cards);
    dialogContainer = new DialogContainer(MTGDialogs.EXILE, params);

    reloadCards();

    // windows settings
    MageFrame.getDesktop().remove(this);
    if (this.isModal()) {
        MageFrame.getDesktop().add(this, JLayeredPane.MODAL_LAYER);
    } else {
        MageFrame.getDesktop().add(this, JLayeredPane.PALETTE_LAYER);
    }
    this.makeWindowCentered();

    // Close on "ESC"
    registerKeyboardAction(e -> onCancel(), KeyStroke.getKeyStroke(KeyEvent.VK_ESCAPE, 0), JComponent.WHEN_ANCESTOR_OF_FOCUSED_COMPONENT);

    this.setVisible(true);
}

